INSERT INTO `travel_package` VALUES (50, 2, 'Cruise Asia on Superstar Gemini', 3599, 'From : $3559\r\n--------------------\r\nPackage includes:\r\n&#8727; Return economy class airfares to Singapore flying Singapore Airlines\r\nex Auckland, Wellington or Christchurch\r\n&#8727; 1 night pre cruise accommodation including breakfast\r\n&#8727; Return transfers airport/hotel & cruise/airport\r\n&#8727; 8 or 15 day SuperStar Gemini cruise ex Singapore\r\n&#8727; All port taxes and insurance surcharges on board the cruise\r\n&#8727; All main meals on board during the cruise\r\n&#8727; All entertainment on board\r\n\r\n<hr>\r\nPackage Includes : Return economy class airfares with Singapore Airlines to Singapore from Auckland,\r\nWellington or Christchurch, 1 nights pre cruise accommodation staying at the Albert Court Hotel including\r\nbreakfast, return airport/hotel & cruise/airport transfers, 8 or 15 day cruise on Superstar Gemini, all\r\nmain meals on board during cruise, all entertainment on board and all port taxes and insurance surcharges\r\non board the cruise.\r\n<hr>\r\nTERMS & CONDITIONS : This airfare can only be sold in conjunction\r\nwith a cruise package. Proof of cruise travel in the\r\nform of an invoice/confirmation slip must be available to\r\nview at any stage throughout the programme year.\r\n', '1', '1127995200', NULL, , 'text/html', '0166_cruise_asia_on_ss_gemini_longlife.pdf', '286569');
